import React from 'react';

function PersonObjectListRendering(props) {
    const personList = [
        {
            id: 1,
            name: "Azhar",
            age : 32,
            skill: "SSE"
        },
        {
            id: 2,
            name: "Adeel",
            age : 32,
            skill: "Financial Advisor"
        },
        {
            id: 3,
            name: "Wasif",
            age : 30,
            skill: "Vaila"
        },
        {
            id: 1,
            name: "Adil",
            age : 31,
            skill: "Accountant"
        }
    ]
    return (
        <div>
            {
                personList.map(person => <h4> I'm {person.name} and have skill {person.skill}</h4>)
            }
        </div>
    );
}

export default PersonObjectListRendering;
